from sklearn.preprocessing import LabelEncoder
from sklearn.neighbors import KNeighborsClassifier
from sklearn.svm import LinearSVC
import numpy as np
def train():
	DB_CONNECT()
	[label_values, encode_values] = DB_LIST()
	encoder = LabelEncoder()
	encoder.fit(label_values)
	
	embedded = np.zeros((len(encode_values), 128))
	for i, value in enumerate(encode_values):
		embedded[i] = value
	
	y = encoder.transform(label_values)
	length = len(encode_values)
	train_idx = np.arange(len(encode_values)) % 2 != 0
	test_idx = np.arange(len(encode_values)) % 2 == 0
	x_train = embedded[train_idx]
	y_train = y[train_idx]
	x_test = embedded[test_idx]
	y_test = y[test_idx]
	knn = KNeighborsClassifier(n_neighbors=1, metric='euclidean')	
	svc = LinearSVC()	
	knn.fit(x_train, y_train)	
	svc.fit(x_train, y_train)
	acc_knn = accuracy_score(y_test, knn.predict(x_test))	
	acc_svc = accuracy_score(y_test, svc.predict(x_test))
	dump(svc, 'models/svc.joblib')
	np.save('models/classes.npy', encoder.classes_)
	
def predict(image):
	svc = load('models/svc.joblib')
	encoder = LabelEncoder()
	encoder.classes_ = np.load('models/classes.npy')
	format, imgstr = image.split(';base64,')	
	img = load_image_from_memory(imgstr)
	img = align_image(img)
	# scale RGB values to interval [0,1]
	img = (img / 255.).astype(np.float32)
	# obtain embedding vector for image
	model = create_model()
	model.load_weights('weights/nn4.small2.v1.h5')
	embedded = model.predict(np.expand_dims(img, axis=0))[0]	
	prediction = svc.predict([embedded])
	identity = encoder.inverse_transform(prediction)[0]		
	return identity
	
