def load_folder(path):
	metadata = []
	for i in os.listdir(path):
		full = os.path.join(path, i)
		ext = os.path.splitext(full)[1]
		if ext == '.jpg' or ext == '.jpeg' or ext =='.png':
			metadata.append(full)
			
			
